/** @jsx jsx */
import React from 'react';
import { css, jsx, Global } from '@emotion/core';

import Layout from '../components/layout';

function Home() {
  const styles = css`
    margin: 0px;
    padding: 0px;
    /* The image used */
    background-image: url("https://images.wallpapersden.com/image/download/camille-league-of-legends_68170_1920x1133.jpg");

    /* Full height */
    height: 100%;

    /* Center and scale the image nicely */
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;

    body {
      background-position: center;
      background-repeat: no-repeat;
      background-size: cover;
    }
  `;

  return (
    <Layout>
      <div css={styles}>
        <input type="text"></input>
        <button>Search</button>
      </div>
    </Layout>
  );
}

export default Home;
